import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [commissionData, setCommissionData] = useState([]);
  const [violationsData, setViolationsData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://script.google.com/macros/s/YOUR_DEPLOYED_WEB_APP_URL/exec');
        const data = await response.json();

        setCommissionData(data.weeklyCommission || []);
        setViolationsData(data.scanningViolationsAndARs || []);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>

      <h2>Weekly Commission</h2>
      <ul>
        {commissionData.map((item, index) => (
          <li key={index}>{item.agentname} - {item.grosspay}</li>
        ))}
      </ul>

      <h2>Scanning Violations & ARs</h2>
      <ul>
        {violationsData.map((item, index) => (
          <li key={index}>{item.agentname} - {item.arcustomername || item.svcustomername}</li>
        ))}
      </ul>
    </div>
  );
};

export default Dashboard;
